DROP TABLE IF EXISTS disputa;

CREATE TABLE disputa (
  fk_Time_TimeID int NOT NULL,
  fk_Jogo_Titulo varchar(45) NOT NULL,
  Torneios int DEFAULT NULL,
  PRIMARY KEY (fk_Time_TimeID, fk_Jogo_Titulo),
  CONSTRAINT FK_DISPUTA_Jogo FOREIGN KEY (fk_Jogo_Titulo) REFERENCES jogo (Titulo),
  CONSTRAINT FK_DISPUTA_Time FOREIGN KEY (fk_Time_TimeID) REFERENCES time (TimeID)
);

